    setCDRParameters(event){
        let currentCDRValues = this.state.cdrConferenceValues;

        Object.keys(currentCDRValues).forEach( key =>{
           currentCDRValues[event.target.name] = event.target.value;
        });

        this.setState({ cdrConferenceValues: currentCDRValues });
    }

	renderExpandedIcon(cell, rows){
		return (
            <div className="expanded-block">
                <FontAwesome id={ rows.conferenceId } name={ this.state.expandView[rows.conferenceId] ? "chevron-circle-down" : "chevron-circle-right" } />
            </div>
        );
	}

    expandedController(rows){
        let expandView = Object.assign({}, this.state.expandView);

        expandView[rows.conferenceId] = ! expandView[rows.conferenceId];
        this.setState({ expandView });
    }

    expandableRow(rows){
    	return !! rows;
    }

    renderWaitingScreen() {
        return this.props.cdr.getIn(['cdr', 'isFetching']) ? <FontAwesome className="fa-3x fa-spin cog-block" name="cog"/> : <span>No data available in table</span>;
    }

    renderTimeStartCell(cell, rows){
        return moment.unix(rows.start).format('YYYY-MM-DD hh:mm:ss');
    }

    renderTimeEndCell(cell, rows){
        return moment.unix(rows.end).format('YYYY-MM-DD hh:mm:ss');
    }

    expandedComponent(rows){
        return (
            <ExpandedCDRComponent expandedData={ rows } />
        ); 
    }

